script: |
  super -f text -I q3283.spq | sort > q3283.out

inputs:
  - name: q3283.spq
    data: |
      SELECT + ( - 90 ) AS col0, - 53 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( col1 ) IS NULL;
  - name: tab1

outputs:
  - name: q3283.out
    data: |
      -90	-53
      -90	-53
      -90	-53
